function Projects(props) {
    return (
        <>
            <div>
                <h2></h2>
                <div>
                    <img src={props.img} alt="Dribble Desigen" className=" bg-gray-200 py-1 px-1 img-box" />
                    <a href="https://fervent-fermi-c83da0.netlify.app" className="text-xs text-gray-300 border-p" target="_blank">{props.heading}</a>
                </div>
            </div>
        </>
    );
}
export default Projects;
